import React,{Component} from 'react';
import {CartContext} from './dataCart' 

export default class Cart extends Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div className='container'>
                <ul className = 'cartContent'>
               <CartContext.Consumer>
                   {
                       ({cartItems}) => cartItems.map(item => 
                       <li className = 'cartItem' key = {item.id}>
                            <img src={item.imageUrl} className='cartImg'/>
                            <p className= 'cartName'>{item.name}</p>
                            <div>
                            <button className='cartButton'>+</button>
                            <span className='cartNumber'>20</span>
                            <button className='cartButton'>-</button>
                            </div>
                            <div className='cartTotal'>haha</div>
                       </li>)
                   }
               </CartContext.Consumer>
               </ul>
            </div>
        )
    }
}
